	Let $X$ be a smooth projective variety over $\mathbb{C}$ with a fixed polarization $H$. Let $\mathcal{M}$ be the moduli space of stable sheaves on $X$ with fixed Chern classes. Then $\mathcal{M}$ admits a perfect obstruction theory.
\end{theorem}

\begin{proof}
	The proof follows from the construction of the moduli space and the deformation theory of sheaves. We sketch the main steps.

	Step 1: Deformation theory. The deformation theory of a stable sheaf $E$ is controlled by the Ext groups $\text{Ext}^i(E,E)$ for $i=1,2$. Specifically, the tangent space at $[E]$ is $\text{Ext}^1(E,E)$, and the obstruction space is $\text{Ext}^2(E,E)$. Moreover, for a stable sheaf, we have $\text{Hom}(E,E) = \mathbb{C}$ and $\text{Ext}^i(E,E)=0$ for $i>2$ by Serre duality and stability.

