# 1. Introduction

The problem involves finding the maximum number of points that lie on the same line in a 2D plane. Given an array of points represented by their coordinates `(x_i, y_i)`, we need to determine the maximum number of points that are collinear.

## Example
Input: `points = [[1,1],[2,2],[3,3]]`
Output: `3`
Explanation: All three points lie on the same straight line.

Input: `points = [[1,1],[3,2],[5,3],[4,1],[2,3],[1,4]]`
Output: `4`
Explanation: Four points lie on the same straight line: `[1,4], [2,3], [3,2], [4,1]`.

# 2. Intuition and Thought Process

## Approach
1. **Problem Analysis**: The challenge is to count the maximum number of collinear points. A straight line can be uniquely defined by its slope and a point it passes through. However, using the slope between two points as a key in a map can help group points that lie on the same line.

2. **Key Insight**: For each point, calculate the slope it makes with every other point. Points that have the same slope relative to a fixed point lie on the same straight line. 

3. **Handling Duplicates and Vertical Lines**: 
   - **Duplicate Points**: If two points are identical, they should be counted separately but lie on any line through that point.
   - **Vertical Lines**: When the line is vertical, the slope is undefined (infinite). We can represent this with a special value (like `INT_MAX` or a string "inf").

4. **Algorithm Selection**:
   - For each point `i`, use a map to count the number of points that have the same slope when paired with `i`.
   - Also, handle duplicate points separately.
   - The maximum number of points for each `i` is the count of duplicates plus the maximum frequency of any slope.

5. **Complexity Analysis**: 
   - **Time Complexity**: O(n²) because for each of the `n` points, we compute slopes with all other `n-1` points.
   - **Space Complexity**: O(n) for storing the slope counts for each point.

# 3. Solution Code
```cpp
#include <vector>
#include <unordered_map>
#include <algorithm>
#include <climits>
using namespace std;

class Solution {
public:
    int maxPoints(vector<vector<int>>& points) {
        int n = points.size();
        if (n <= 2) return n;

        int maxCount = 0;
        for (int i = 0; i < n; i++) {
            unordered_map<double, int> slopeCount;
            int duplicate = 1;
            int currentMax = 0;

            for (int j = 0; j < n; j++) {
                if (i == j) continue;

                int x1 = points[i][0], y1 = points[i][1];
                int x2 = points[j][0], y2 = points[j][1];

                if (x1 == x2 && y1 == y2) {
                    duplicate++;
                    continue;
                }

                double slope;
                if (x1 == x2) {
                    slope = INT_MAX;
                } else {
                    slope = (double)(y2 - y1) / (double)(x2 - x1);
                }

                slopeCount[slope]++;
                currentMax = max(currentMax, slopeCount[slope]);
            }

            maxCount = max(maxCount, currentMax + duplicate);
        }

        return maxCount;
    }
};
